window.bookSummaryJSON = "<p>Shortlisted for the Arthur C. Clarke Award 2020!</p> <p>\"A terrifying tour de force.\" (James Rollins)</p> <p>\"Readers will be riveted.\" (<i>Publishers Weekly</i>, starred review)</p> <p>Sally Jansen was NASA's leading astronaut, until a mission to Mars ended in disaster. Haunted by her failure, she lives in quiet anonymity, convinced her days in space are over.</p> <p>She's wrong.</p> <p>A large alien object has entered the solar system on a straight course toward Earth. It has made no attempt to communicate. Out of time and out of options, NASA turns to Jansen. But as the object reveals its secrets, Jansen and her crew find themselves in a desperate struggle for survival - against the cold vacuum of space and something far, far worse....</p> <p>\"Breathless, compulsive reading.\" (Christopher Golden)</p> <p>\"A suspenseful, fast-paced story of first contact.\" (<i>Kirkus</i>)</p>"; 
